import Header from './Header';


const layoutStyle = {
  margin: 0,
  padding: 0,
};

const Layout = props => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
    <div id="container">
      <ol class="breadcrumb">
        <li class="breadcrumb-item"><a href="#">Home</a></li>
        <li class="breadcrumb-item"><a href="#">Library</a></li>
        <li class="breadcrumb-item active">Data</li>
      </ol>
    </div>
  </div>
);

export default Layout;
